import React from 'react';
import { Map, GeoJSON } from "react-leaflet";
import "leaflet/dist/leaflet.css";

function Covidmap({ countries }) {


    return (
        <Map style={{ height: "90vh" }}
            zoom={1}
            center={[20, 100]}>
            < GeoJSON data={countries} />
        </Map>

    )
}
export default Covidmap;
